import React from "react";
import "../styles/home.css";
import Navbar from "../components/Navbar";
import addTransactionBtn from "../assets/add_transaction.png"; // đã sửa tên hình

export default function Home() {
  return (
    <>
      <Navbar />
      <div className="welcome-container">
        <img
          src={require("../assets/Trang_chu/Icon.png")}
          alt="chart icon"
          className="welcome-logo"
        />
        <div className="welcome-title">Tổng quan chi tiêu</div>
        <div className="welcome-desc">Chào mừng bạn đến với EMG</div>
        <div className="welcome-btn-group">
          <img
            src={addTransactionBtn}
            alt="Thêm giao dịch"
            className="welcome-button-img"
          />
        </div>
      </div>
    </>
  );
}
